import React from "react";

type InputProps = {
  // The common Part
  className: string;
  type: string;
  value: any;
  onChange?: (e: React.ChangeEvent<HTMLInputElement>) => void;
  labelText: string;
  labelClass: string;
  parentDivClass: string;
} & {
  // The discriminated union
  step?: string;
  min?: string;
};

export const Textfield: React.FC<InputProps> = (props: InputProps) => {
  return (
    <div className="col-sm-5">
      <label className={props.labelClass}>{props}</label>
      <input {...props} />
    </div>
  );
};
